import React from 'react';

const Menu =()=> {
    return (
        <nav className='menu'>
            <div>
                <a>Profile</a>
            </div>

            <div>
                <a>Message</a>
            </div>

            <div>
                <a>News</a>
            </div>

            <div>
                <a>Music</a>
            </div>

            <div>
                <a>Setting</a>
            </div>

        </nav>
    )
};

export default Menu();
